telemetry = []

def save_images(base_path, base_save_path, folder, filename):
  full_path = f'{base_path}\\{folder}\\{filename}'

  try:
    f = h5py.File(full_path, 'r')

    for i in range(len(f['rgb'])):
      output_filename = f'{folder}\\{filename}_{i}.{filetype}'
      output_file = f'{base_save_path}\\{output_filename}'
      cv2.imwrite(output_file, np.array(f['rgb'][i]))

      telemetry.append(np.append([output_filename, folder], np.array(f['targets'][i])))

    f.close()
  except Exception as e:
    print(f'Unable to read {full_path}\nAn exception occurred: {e}')

for f in tqdm(range(len(seq_train_filenames))):
  save_images(base_path, base_save_path, "SeqTrain", seq_train_filenames[f])

for f in tqdm(range(len(seq_val_filenames))):
# for f in tqdm(range(3)):
  save_images(base_path, base_save_path, "SeqVal", seq_val_filenames[f])

